column1:
@bancodobrasil oxi nem o sac de vocês resolve 
Antes de bloquear uma conta com dinheiro vocês devem primeiro ligar e verificar se é a pessoa tentando fazer a movimentação! To eu no app pagando conta e vocês bloqueiam todas as senhas e acesso alegando “ser para minha segurança” 
Eu com três crianças em casa, pagando conta pelo app (sendo uma das crianças necessitando de cuidados por ter crises de convulsão) e vocês simplesmente bloqueiam tudo! Ou seja, se nessa noite eu tivesse uma emergência com minha filha eu faria o q? Pq segundo vocês eu deveria ir até uma agência em horário comercial! Vocês bloquearam minhas senhas todas e alegaram não poder desbloquear! Coincidentemente sempre a noite e nos finais de semana onde fico impedida de usar meu dinheiro! Pix, débito, nada funciona! Absurdo isso! E vocês já fizeram isso mais de uma vez
